import { Outlet, Route, Routes } from 'react-router-dom';
import Home from "./routes/home/home.component";

const Navigation = () => {
  return (
    <div>
      <div>
        <h1> Iam the nav</h1>
      </div>
      <Outlet />
    </div>
  )
}
const App = () => {

  return (
  <Routes>
  <Route path='/' element={<Navigation />}>
  <Route path='/home' element={<Home />} />

  </Route>
  </Routes>
  )
}

export default App;
